window.bookSummaryJSON = "<p>Earth's Star Force Marines invade an alien world!</p> <p>In the second book of the Star Force series, Kyle Riggs has another bad year. The Nano ships have a new mission - one that sentences their pilots to death. Meanwhile, the governments of Earth want to steal Star Force's Nano technology for their own. Worst of all, Earth has made a promise to the Macros, and the machines are coming to collect. </p> <p><i>Extinction</i> is the story of Earth's entry into an interstellar war between living creatures and machines. And to buy the peace, we've signed up with the machines.</p>"; 
